import { Component } from "react";
import React from "react";
import Table from 'react-bootstrap/Table';
import 'bootstrap/dist/css/bootstrap.min.css'
import DataTable from "react-data-table-component";

class PatientsTable extends Component {
    componentDidMount() {
        fetch('/api/v1/patients', {
            method: 'GET',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
        })
            .then(res => res.json())
            .then(
                (result) => {
                    console.log(result)
                },
                (error) => {
                    console.log(error)
                }
            )
    }


    //   const PatientTable = patients.map((cust, index) => PatientRow(cust, index))

    tableHeader = <thead className='bgvi'>
        <tr>
            <th>Patient Name</th>
            <th>Age</th>
            <th>Symptoms</th>
            <th>Comments</th>
            <th>Room Number</th>
        </tr>
    </thead>

    headings = [
        'Product name',
        'SKU',
        'Stock quantity',
        'Wholesale cost',
        'Sale price',
        'Quantity sold',
        'Gross sales',
        'Net sales',
        'Notes',
    ];


    /*
    PatientRow = (patient, index) => {

        return (
            <tr key={index} className='even'>
                <td>{patient.patientName}</td>
                <td>{patient.age}</td>
                <td>{patient.symptoms}</td>
                <td>{patient.comments}</td>
                <td>{patient.roomNumber}</td>
            </tr>
        )
    }*/



    render() {
        return (
            <div>
                <DataTable title="Arnold Movies" columns={columns} data={data}></DataTable>
                <Table striped bordered hover>
                    <thead className='bgvi'>
                        <tr>
                            <th>Patient Name</th>
                            <th>Age</th>
                            <th>Symptoms</th>
                            <th>Comments</th>
                            <th>Room Number</th>
                        </tr>
                    </thead>
                    <tbody>
                        {/*PatientTable*/}
                    </tbody>
                </Table>
            </div>
        )
    }

}
const data = [{ id: 1, title: 'Conan the Barbarian', year: '1982' }];
const columns = [
    {
        name: 'Title',
        selector: 'title',
        sortable: true,
    },
    {
        name: 'Year',
        selector: 'year',
        sortable: true,
        right: true,
    },
];


export default PatientsTable;
